import React, { useState } from 'react'
import { NavLink } from 'react-router-dom';
import './register_style.css'

const RegisterDoctor = () => {

    const Navigate = useNavigate()
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [firstname, setFirstname] = useState('')
    const [surname, setSurname] = useState('')
    const [birthdate, setBirthdate] = useState('')
    const [error, setError] = useState(0)

    validate_input = () => {
        if(email.length === 0 || password.length === 0
            || firstname.length === 0 || surname === 0
            || birthdate === '' || specialization.length === 0
            || doccode.length === 0) {
            setError(1)
            return false
        }
        if(!(email.endsWith('@gmail.com') || email.endsWith('@yahoo.com'))) {
            setError(2)
            return false;
        }
        if(password.length < 8) {
            setError(3)
            return false;
        }
        if(doccode.length !== 12) {
            setError(4)
            return false;
        }
        setError(0)
        return true;
    }

    submit_register = (event) =>{
        event.preventDefault();
        let valid = this.validate_input();
        if(valid)
            console.log(email + " " + password + " " + firstname + " " + surname + " " + birthdate + " " + education + " " + doccode + " " + specialization);
        this.setState({email : ''});
        this.setState({password: ''});
        this.setState({firstname: ''});
        this.setState({surname: ''});
        this.setState({birthdate: ''});
        this.setState({education: ''});
        this.setState({doccode: ''});
        this.setState({specialization: 's1'});
    }

    ev_email = (event) => {
        this.setState({email : event.target.value});
    }
    ev_password = (event) => {
        this.setState({password : event.target.value});
    }
    ev_firstname = (event) => {
        this.setState({firstname : event.target.value});
    }
    ev_surname = (event) => {
        this.setState({surname : event.target.value});
    }
    ev_date = (event) => {
        this.setState({birthdate : event.target.value})   
    }
    ev_education = (event) => {
        this.setState({education : event.target.value});
    }
    ev_doccode = (event) => {
        this.setState({doccode : event.target.value});
    }
    ev_specialization = (event) => {
        this.setState({specialization : event.target.value});
    }

    return (
        <div className= "registerdoctor">
            <p style={{fontSize: 35,paddingTop: 30}}>Register</p>
            <div className='topbuttonsheader'>
            <NavLink className='topbuttons' to = "../register">Patient<></></NavLink><label className='current'>Doctor</label>
            </div>
            <form onSubmit={this.submit_register}>

            <label >Email</label>
                <input type = "text" placeholder='type your email' value = {email} onChange = {this.ev_email}/>

                <label >Password</label>
                <input type = "password" placeholder='type your password' value = {password} onChange = {this.ev_password}/>

                <label >First Name</label>

                <input type = "text" placeholder='type your first name' value = {firstname} onChange = {this.ev_firstname}/>

                <label >Surname</label>

                <input type = "text" placeholder='type your surname' value = {surname} onChange = {this.ev_surname}/>

                <label >Education</label>

                <input type = "text" placeholder='type your education' value = {education} onChange = {this.ev_education}/>

                <label >Specialization</label>

                <select value={specialization} onChange = {this.ev_specialization}>
                <option value="s1">Allergy and immunology</option>
                <option value="s2">Dermatology</option>
                <option value="s3">Family medicine</option>
                <option value="s4">Neurology</option>
                <option value="s5">Obstetrics and gynecology</option>
                <option value="s6">Pediatrics</option>
                <option value="s7">Psychiatry</option>
                <option value="s8">Urology</option>

                </select>

                <label >Doctor Code</label>

                <input type = "text" placeholder='type your doctor code' value = {doccode} onChange = {this.ev_doccode}/>

                <label>Date of Birth</label>

                <input type="date" value={birthdate} onChange={this.ev_date}/>

                <div className = "buttonc">
                <button>register</button>
                {error === 1 && <p style={{fontSize:17, color: 'red'}}>All fields are required</p>}
                {error === 2 && <p style={{fontSize:17, color: 'red'}}>Invalid email</p>}
                {error === 3 && <p style={{fontSize:17, color: 'red'}}>Password must have minimum 8 characters</p>}
                {error === 4 && <p style={{fontSize:17, color: 'red'}}>Doctor code must have 12 characters</p>}

                <p style={{fontSize:17, marginTop:200}}>Already a member? <NavLink to = "/" style={{textDecoration: "none"}}>Login</NavLink> </p>

                </div>
            </form>
        </div>
    );
}

export default RegisterDoctor;
